import React from 'react';
import './ProfileCard.css'; // Import the CSS file for styling
import image from "./Chemistry.jpg";

const ProfileCard = ({ matricMarks, interMarks, quizzesPercentage }) => {
  return (
    <div className="profile-card">
      <div className="avatar">
        <img src={image} alt="Profile Avatar" />
      </div>
      <div className="marks-section">
        <div className="marks">
          <p>Matric Marks:</p>
          <span>{matricMarks}</span>
        </div>
        <div className="marks">
          <p>Inter Marks:</p>
          <span>{interMarks}</span>
        </div>
      </div>
      <div className="quizzes-percentage">
        <p>Quizzes Percentage:</p>
        <span>{quizzesPercentage}%</span>
      </div>
    </div>
  );
};

export default ProfileCard;
